import React from "react";
export function InputForm ({handleChange, name}){
    return (
        <>
        <h2>Name</h2>
        <input
            name='name'
            placeholder = "Please put the name"
            onChange = {handleChange}
            value={name}
            type="text"
        />
        </>
    )}
